import React, {useState} from "react";

function App() {



  function onChange(event) {
    console.log(event.target.value);
  }

  return (
    <div className="container">
      <h1>{onChange} </h1>
      <input 
      onChange={onChange} 
      type="text" 
      placeholder="What's your name?" />
      <button>Submit</button>
    </div>
  );
}

export default App;
